import React from 'react';

const PaymentPage = ({ cartItems, goBackToCart, handlePaymentSuccess }) => {
  // Calculate subtotal
  const subtotal = cartItems.reduce((total, item) => total + item.price, 0);

  return (
    <div>
      <h1>Payment</h1>
      <div>
        <h2>Cart Items</h2>
        <ul>
          {cartItems.map((item, index) => (
            <li key={index}>
              {item.name} - ${item.price}
            </li>
          ))}
        </ul>
        <p>Subtotal: ${subtotal.toFixed(2)}</p>
        {/* Add payment form and other payment-related elements */}
      </div>
      <button onClick={goBackToCart}>Back to Cart</button>
      <button onClick={handlePaymentSuccess}>Complete Payment</button>
    </div>
  );
};

export default PaymentPage;
